import React from 'react';
import PodcastCard from './Pod'

class Popular extends React.Component {
    constructor(props) {
        super(props);
        }

    render() {
        console.log('popularpodcasts', this.props.podcasts);
        return (
            <div>
                {
                    this.props.podcasts.map(podcast => {
                        return <li>{podcast.email}</li>
                    })
                }
            </div>
        )    
    }
    
}

export default Popular;
